  false,\n\t\"url\": null,\n\t\"notes\": \"In 1996 an aerial breeding pair survey
  was conducted on the Arctic Coastal Plain of Alaska for the 11th consecutive year.
  All major species of waterfowl indicated increased population estimates over 1995
  except for scaup (-5%), scoter (-35%), red-breasted mergansers (-22.1%), snow goose
  (-41.6), and brant (-48.2%). The population estimate for northern pintail (252,661)
  increased 9% over 1995 and 10.2% more than the 11-year mean. Estimates for oldsquaw,
  greater white-fronted goose, yellow-billed loon, red-throated loon, and tundra swan
